import React from 'react';
import "./landingPic.css"

function landingPic(){

    return(
        <div id='LP'>
            <div className='container'>
                <img src="images/F1.jpg" alt="" className="left_pic" />
            </div>
            <div className='container'>
                <img src="images/lambo.jpg" alt="" className="right_pic" />
            </div>
        </div>
    );
}

export default landingPic;
